func testDTBDeliveryDurationToManyRemoveOpDeliveryDurationDTBProductClasses(t *testing.T) {
	var err error

	ctx := context.Background()
	tx := MustTx(boil.BeginTx(ctx, nil))
	defer func() { _ = tx.Rollback() }()

	var a DTBDeliveryDuration
	var b, c, d, e DTBProductClass

	seed := randomize.NewSeed()
	if err = randomize.Struct(seed, &a, dtbDeliveryDurationDBTypes, false, strmangle.SetComplement(dtbDeliveryDurationPrimaryKeyColumns, dtbDeliveryDurationColumnsWithoutDefault)...); err != nil {
		t.Fatal(err)
	}
	foreigners := []*DTBProductClass{&b, &c, &d, &e}
	for _, x := range foreigners {
		if err = randomize.Struct(seed, x, dtbProductClassDBTypes, false, strmangle.SetComplement(dtbProductClassPrimaryKeyColumns, dtbProductClassColumnsWithoutDefault)...); err != nil {
			t.Fatal(err)
		}
	}

	if err := a.Insert(ctx, tx, boil.Infer()); err != nil {
		t.Fatal(err)
	}

	err = a.AddDeliveryDurationDTBProductClasses(ctx, tx, true, foreigners...)
	if err != nil {
		t.Fatal(err)
	}

	count, err := a.DeliveryDurationDTBProductClasses().Count(ctx, tx)
	if err != nil {
		t.Fatal(err)
	}
	if count != 4 {
		t.Error("count was wrong:", count)
	}

	err = a.RemoveDeliveryDurationDTBProductClasses(ctx, tx, foreigners[:2]...)
	if err != nil {
		t.Fatal(err)
	}

	count, err = a.DeliveryDurationDTBProductClasses().Count(ctx, tx)
	if err != nil {
		t.Fatal(err)
	}
	if count != 2 {
		t.Error("count was wrong:", count)
	}

	if !queries.IsValuerNil(b.DeliveryDurationID) {
		t.Error("want b's foreign key value to be nil")
	}
	if !queries.IsValuerNil(c.DeliveryDurationID) {
		t.Error("want c's foreign key value to be nil")
	}

	if b.R.DeliveryDuration != nil {
		t.Error("relationship was not removed properly from the foreign struct")
	}
	if c.R.DeliveryDuration != nil {
		t.Error("relationship was not removed properly from the foreign struct")
	}
	if d.R.DeliveryDuration != &a {
		t.Error("relationship to a should have been preserved")
	}
	if e.R.DeliveryDuration != &a {
		t.Error("relationship to a should have been preserved")
	}

	if len(a.R.DeliveryDurationDTBProductClasses) != 2 {
		t.Error("should have preserved two relationships")
	}

	// Removal doesn't do a stable deletion for performance so we have to flip the order
	if a.R.DeliveryDurationDTBProductClasses[1] != &d {
		t.Error("relationship to d should have been preserved")
	}
	if a.R.DeliveryDurationDTBProductClasses[0] != &e {
		t.Error("relationship to e should have been preserved")
	}
}

